(18, 'বিভিন্ন পরীক্ষার পরিসংখ্যান', 'exam-statistics', NULL, 22, 0, '<table class=\"dataTable table table-bordered table-striped\">\r\n <tbody>\r\n  <tr>\r\n   <td><p>সন</p></td>\r\n   <td><p>মোট পরীক্ষার্থী</p></td>\r\n   <td><p>মোট উত্তীর্ণ</p></td>\r\n   <td><p>পাশের হার</p></td>\r\n   <td><p>A+</p></td>\r\n   <td><p>A</p></td>\r\n   <td><p>A-</p></td>\r\n  </tr>\r\n  <tr>\r\n   <td><p>২০১৫</p></td>\r\n   <td>২১৫</td>\r\n   <td>২১৫</td>\r\n   <td><p>৯৩%</p></td>\r\n   <td>১৫</td>\r\n   <td>২৫</td>\r\n   <td>২৫</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n', '2015-09-08', NULL, 1, 1),
(19, 'লক্ষ ও উদ্দেশ্য', 'our-goal', NULL, 1, 0, '(ক) পাবলিক পরীক্ষার ফলাফল উন্নয়ন। <br>(খ) সামাজিক ব্যাধি প্রাকৃতিক দূর্যোগ মোকাবিলা করার জন্য শিক্ষক ও শিক্ষার্থীদেরকে সচেতন করে গড়ে তোলা। <br>(গ) নৈতিক চরিত্রের উন্নয়ন সাধন করে যোগ্য নাগরিক করে গড়ে তোলা। <br>(ঘ) চ.ঞ.অ ও চইগ বাস্তবায়ন করতঃ বিদ্যালয়ের পাঠদান সহ অন্যান্য কার্যক্রম অব্যাহত রাখা, জুনিয়র বৃত্তি সহ জে.এস.সি ও এস.এস.সি পরীক্ষার্থী আলাদাভাবে পাঠদান পূর্বক বিদ্যালয়ের পাবলিক পরীক্ষা ফলাফল ১০০% উন্নীত করা।', '2015-10-08', 0, 1, 1),
(20, 'পরিচালনা পর্ষদ', 'governing-body', NULL, 2, 0, '<table class=\"table table-bordered\">\r\n\r\n<tbody>\r\n<tr>\r\n	<td>\r\n		ক্রমিক নং\r\n</td>\r\n	<td>\r\nনাম\r\n</td>\r\n\r\n<td>\r\nপদবী\r\n </td>\r\n<td>\r\nমোবাইল  নং\r\n </td>\r\n</tr>\r\n<tr>\r\n<td>১</td>		\r\n<td>জনাব ববিন হায়দার চৌধুরী</td>\r\n<td>সভাপতি (দাতা সদস্য)</td>\r\n<td>০১৭১২১০২৫৭২</td>\r\n\r\n\r\n</tr>			\r\n<tr>\r\n<td>২</td>\r\n<td> জনাব মোঃ রেজাউল করিম</td>\r\n<td>কো-অপ্ট সদস্য</td>\r\n<td>০১৭১৬৮৩৬৪৩৯</td>\r\n\r\n\r\n</tr>\r\n	\r\n<tr>\r\n<td>৩</td>					\r\n\r\n<td>জনাব মোঃ হুমায়ুন তালুকদার</td>\r\n<td> অভিভাবক সদস্য</td>\r\n<td> ০১৭২৭৭৩৪১৮২</td>\r\n\r\n</tr>\r\n\r\n<tr>\r\n<td>৪</td>			\r\n<td>জনাব মোঃ শাহজাহান মন্ডল </td>			\r\n<td>অভিভাবক সদস্য</td>\r\n<td>০১৭১৫৩০৪৩০১</td>\r\n\r\n\r\n</tr>\r\n\r\n<tr>\r\n<td>৫</td>					\r\n<td>জনাব মোঃ সাদিকুর রহমান</td>\r\n<td>অভিভাবক সদস্য</td>\r\n<td> ০১৭১২৪৬০৯৮৩</td>\r\n\r\n</tr>\r\n\r\n<tr>\r\n<td>৬</td>								\r\n<td>জনাব মোঃ খলিলুর রহমান</td>\r\n<td> অভিভাবক সদস্য</td>\r\n<td>০১৭১৫৬২৮৬০১</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>৭</td>									\r\n<td>জনাবা মোছাঃ জারিনা </td>\r\n<td> সংরক্ষিত মহিলা অভিভাবক সদস্য</td>\r\n<td> ০১৭৪৯১১৬৪৮০</td>\r\n\r\n</tr>	\r\n<tr>\r\n<td>৮</td>									\r\n<td>জনাবা নাজমুন নাহার</td>\r\n<td>মহিলা শিক্ষক প্রতিনিধি</td>\r\n<td>০১৭১৮০২৮১৮৮</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>৯</td>									\r\n<td>জনাব মোঃ আলাল হোসেন</td>\r\n<td>সাধারণ শিক্ষক সদস্য</td>\r\n<td>০১৭৬০৮৩৫৭৫৬</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>১০</td>									\r\n<td>  জনাব শাকের আহাম্মেদ </td>\r\n<td> শিক্ষক প্রতিনিধি</td>\r\n<td>০১৭২৭২১২৮১৩</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>১১</td>									\r\n<td>জনাব মোঃ শামছুল হক</td>\r\n<td> প্রধান শিক্ষক/ সদস্য সচিব</td>\r\n<td> ০১৭১৮৮৮৪০৪১</td>\r\n\r\n</tr>\r\n\r\n</tbody></table>', '2015-06-09', 0, 1, 1),
